function calculateLoan() {
    var principal = document.getElementById('principal').value;
    var annualInterestRate = document.getElementById('interest').value;
    var months = document.getElementById('months').value;
    var method = document.getElementById('method').value;
  
     // Error checking
    if (principal <= 0 || annualInterestRate <= 0 || months <= 0) {
        alert('Please enter positive values for loan amount, interest rate, and loan term.');
        return;
    }

    var monthlyInterestRate = annualInterestRate / 12 / 100;
    var numberOfPayments = months;
    var discountFactor = (Math.pow(1 + monthlyInterestRate, numberOfPayments) - 1) / (monthlyInterestRate * Math.pow(1 + monthlyInterestRate, numberOfPayments));
    var annuity = principal / discountFactor;

    var deductions = method === 'reducing' ? {
        loanInsurance: 0.02 * principal,
        fosaLoanAppraisal: 0.01 * principal,
        guarantorNotification: 100,
        crbSearch: 100,
        loanForm: 100,
        exciseDuty: 0.10 * 0.02 * principal
    } : {
        upfrontCharge: Math.round(principal / 27.777)
    };
    var totalDeductions = Object.values(deductions).reduce(function(a, b) { return a + b; }, 0);

    var schedule = [];
    var remaining = principal;
    var totalInterest = 0;
    for (var i = 0; i < numberOfPayments; i++) {
        var interest = remaining * monthlyInterestRate;
        var principalPayment = method === 'reducing' ? annuity - interest : principal / numberOfPayments;
        remaining -= principalPayment;
        totalInterest += interest;

        var paymentDate = new Date();
        paymentDate.setMonth(paymentDate.getMonth() + i + 1);

        schedule.push({
            paymentDate: paymentDate,
            principalPayment: principalPayment,
            interest: interest,
            totalPayment: principalPayment + interest,
            remaining: remaining
        });
    }

    var output = document.getElementById('output').getElementsByTagName('tbody')[0];
    output.innerHTML = '';
    for (var i = 0; i < schedule.length; i++) {
        var payment = schedule[i];
        var row = output.insertRow();
        row.insertCell(0).innerHTML = payment.paymentDate.toLocaleDateString();
        row.insertCell(1).innerHTML = 'KES ' + payment.principalPayment.toFixed(2);
        row.insertCell(2).innerHTML = 'KES ' + payment.interest.toFixed(2);
        row.insertCell(3).innerHTML = 'KES ' + payment.totalPayment.toFixed(2);
        row.insertCell(4).innerHTML = 'KES ' + payment.remaining.toFixed(2);
    }

    document.getElementById('totalInterest').innerHTML = 'KES ' + totalInterest.toFixed(2);
    document.getElementById('totalRepayment').innerHTML = 'KES ' + (parseFloat(principal) + totalInterest + totalDeductions).toFixed(2);
   var deductionsOutput = document.getElementById('deductions');
    deductionsOutput.innerHTML = '<h3>Deductions</h3><ul>';
    for (var deduction in deductions) {
        deductionsOutput.innerHTML += '<li>' + deduction + ': KES ' + deductions[deduction].toFixed(2) + '</li>';
    }
    deductionsOutput.innerHTML += '<li><strong>Total Deductions: KES ' + totalDeductions.toFixed(2) + '</strong></li></ul>';
   window.scrollTo({
        top: document.getElementById('output').offsetTop,
        behavior: 'smooth'
    });
   // Return the schedule array and deductions object
   return { schedule: schedule, deductions: deductions };
}
