function buildTableBody(schedule) {
    var body = [];
    // Use the schedule array as the data source
    var data = schedule;
    body.push(['Payment Date', 'Principal Payment (KES)', 'Interest (KES)', 'Total Payment (KES)', 'Remaining (KES)']);
    data.forEach(function(row) {
        body.push([row.paymentDate.toLocaleDateString(), 'KES ' + row.principalPayment.toFixed(2), 'KES ' + row.interest.toFixed(2), 'KES ' + row.totalPayment.toFixed(2), 'KES ' + row.remaining.toFixed(2)]);
    });
    return body;
}

function buildDeductionsBody(deductions) {
    var body = [];
    body.push(['Deduction', 'Amount (KES)']);
    var totalDeductions = 0;
    for (var deduction in deductions) {
        body.push([deduction, 'KES ' + deductions[deduction].toFixed(2)]);
        totalDeductions += deductions[deduction];
    }
    // Add a new row with the total deductions value and bold style
    body.push([{ text: 'Total Deductions', bold: true }, { text: 'KES ' + totalDeductions.toFixed(2), bold: true }]);
    return body;
}

